const select = document.getElementById('treeSelect');
Object.keys(TREES).sort().forEach(function(k) {
  const opt=document.createElement('option'); opt.value=k; opt.textContent=k;
  select.appendChild(opt);
});
const docEl=document.getElementById('doc');
const searchEl=document.getElementById('search');

const svg = d3.select("#canvas");
const g = svg.append("g");
const zoom = d3.zoom().scaleExtent([0.15, 4]).on("zoom", function(event){ g.attr("transform", event.transform); });
svg.call(zoom);

let root, treeLayout, diagonal;

function sizeToContainer() {
  const r = document.getElementById('main').getBoundingClientRect();
  svg.attr("width", r.width).attr("height", r.height);
}
window.addEventListener('resize', function(){ sizeToContainer(); render(); });
sizeToContainer();

function setCollapsed(node, depth, maxDepth) {
  if (!node.children) return;
  node.children.forEach(function(ch){ setCollapsed(ch, depth+1, maxDepth); });
  if (depth >= maxDepth) {
    node._children = node.children;
    node.children = null;
  }
}

function expand(node) {
  if (node._children) {
    node.children = node._children;
    node._children = null;
  }
  if (node.children) node.children.forEach(expand);
}

function collapse(node) {
  if (node.children) {
    node._children = node.children;
    node.children = null;
  }
  if (node._children) node._children.forEach(collapse);
}

function expandToDepth(node, depth, target) {
  if (depth < target) {
    if (node._children) {
      node.children = node._children;
      node._children = null;
    }
    if (node.children) node.children.forEach(function(ch){ expandToDepth(ch, depth+1, target); });
  } else {
    if (node.children) {
      node._children = node.children;
      node.children = null;
    }
  }
}

function findNodeBySubstring(node, q, hits) {
  const label = (node.data.name || "").toLowerCase();
  if (label.indexOf(q) !== -1) hits.push(node);
  (node.children||[]).forEach(function(ch){ findNodeBySubstring(ch,q,hits); });
  (node._children||[]).forEach(function(ch){ findNodeBySubstring(ch,q,hits); });
}

function centerOn(node) {
  const r = document.getElementById('main').getBoundingClientRect();
  const t = d3.zoomTransform(svg.node());
  const x = node.y;
  const y = node.x;
  const scale = t.k;
  const tx = r.width/2 - x*scale;
  const ty = r.height/2 - y*scale;
  svg.transition().duration(250).call(zoom.transform, d3.zoomIdentity.translate(tx,ty).scale(scale));
}

function loadTree(name) {
  const data = TREES[name];
  root = d3.hierarchy(data);
  root.x0 = 0; root.y0 = 0;
  setCollapsed(root, 0, 2);
  treeLayout = d3.tree().nodeSize([22, 160]);
  diagonal = d3.linkHorizontal().x(function(d){ return d.y; }).y(function(d){ return d.x; });
  window.__depthTarget = 2;
  docEl.textContent = "Select a node to see documentation here.";
  render(true);
}

function render(resetZoom) {
  if (!root) return;
  treeLayout(root);
  const nodes = root.descendants();
  const links = root.links();

  const node = g.selectAll("g.node").data(nodes, function(d){ return d.id || (d.id = crypto.randomUUID()); });

  const nodeEnter = node.enter().append("g")
    .attr("class","node")
    .attr("transform", function(){ return "translate("+(root.y0||0)+","+(root.x0||0)+")"; })
    .style("cursor","pointer")
    .on("click", function(event,d){
      if (d.children) { d._children=d.children; d.children=null; }
      else if (d._children) { d.children=d._children; d._children=null; }
      docEl.textContent = (d.data.doc ? d.data.doc + "\n\n" : "") + "Path: " + d.ancestors().reverse().map(function(a){ return a.data.name; }).join(" / ");
      render(false);
      centerOn(d);
    });

  nodeEnter.append("circle")
    .attr("r", 5)
    .attr("fill", function(d){ return d._children ? "#555" : "#999"; });

  nodeEnter.append("text")
    .attr("dy","0.32em")
    .attr("x", function(d){ return d._children ? -10 : 10; })
    .attr("text-anchor", function(d){ return d._children ? "end" : "start"; })
    .style("font-size","12px")
    .text(function(d){ return d.data.name; });

  const nodeUpdate = nodeEnter.merge(node);
  nodeUpdate.transition().duration(200)
    .attr("transform", function(d){ return "translate("+d.y+","+d.x+")"; });
  nodeUpdate.select("circle").attr("fill", function(d){ return d._children ? "#555" : "#999"; });

  node.exit().transition().duration(150)
    .attr("transform", function(){ return "translate("+(root.y||0)+","+(root.x||0)+")"; })
    .remove();

  const link = g.selectAll("path.link").data(links, function(d){ return d.target.id; });

  link.enter().insert("path","g")
    .attr("class","link")
    .attr("fill","none")
    .attr("stroke","#bbb")
    .attr("stroke-width",1.2)
    .attr("d", function() {
      const o={x: root.x0||0, y: root.y0||0};
      return diagonal({source:o,target:o});
    })
    .merge(link)
    .transition().duration(200)
    .attr("d", diagonal);

  link.exit().transition().duration(150).remove();

  root.x0 = root.x; root.y0 = root.y;

  if (resetZoom) {
    const r = document.getElementById('main').getBoundingClientRect();
    svg.call(zoom.transform, d3.zoomIdentity.translate(r.width*0.25, r.height/2).scale(1));
  }
}

document.getElementById('expandAll').onclick=function(){ expand(root); render(false); };
document.getElementById('collapseAll').onclick=function(){ collapse(root); render(false); };
document.getElementById('expand1').onclick=function(){
  let target = window.__depthTarget || 2;
  target += 1;
  window.__depthTarget=target;
  expandToDepth(root,0,target);
  render(false);
};
document.getElementById('collapse1').onclick=function(){
  let target = window.__depthTarget || 2;
  target = Math.max(0, target-1);
  window.__depthTarget=target;
  expandToDepth(root,0,target);
  render(false);
};

let searchTimer=null;
searchEl.addEventListener('input', function() {
  clearTimeout(searchTimer);
  searchTimer=setTimeout(function(){
    const q=searchEl.value.trim().toLowerCase();
    if(!q) return;
    const hits=[];
    findNodeBySubstring(root,q,hits);
    if(hits.length){
      const d=hits[0];
      d.ancestors().forEach(function(a){ if(a._children){a.children=a._children;a._children=null;} });
      render(false);
      centerOn(d);
      docEl.textContent = (d.data.doc ? d.data.doc + "\n\n" : "") + "Path: " + d.ancestors().reverse().map(function(a){ return a.data.name; }).join(" / ");
    } else {
      docEl.textContent="No match for: "+q;
    }
  }, 150);
});

select.addEventListener('change', function(){ loadTree(select.value); });
loadTree(select.value || select.options[0].value);
</script>
</body>
</html>
